  input: process.stdin,
  output: process.stdout
});

rl.question('Please enter your name: ', (answer) => {
  console.log(`Hello ${answer}!`);
  rl.close();
});
```

This is a simple example of how to read user input in TypeScript using the `readline` module. The `createInterface()` method is used to create an interface with `process.stdin` as the input stream and `process.stdout` as the output stream. The `question()` method is then used to prompt the user for input, and the provided answer is logged to the console. Finally, the interface is closed with the `close()` method.

